from database import ConnectionPool,showApptsData,addApptsData,delApptsData,updtApptsData

class AppntDataRetrievalThread(QtCore.QThread):
    dataRetrieved = QtCore.pyqtSignal(object)
    retrievalComplete = QtCore.pyqtSignal()
    def __init__(self, parent=None):
        super(AppntDataRetrievalThread, self).__init__(parent)

    def run(self):
        try:
                pool = ConnectionPool(5, 'hms_database.db')
                data = showApptsData(pool)
                self.dataRetrieved.emit(data)
        except Exception as e:
            print(e)

class AddUpdateDelAppntDataThread(QtCore.QThread):
    operationComplete = QtCore.pyqtSignal()
    def __init__(self,data,flag,parent=None):
        super(AddUpdateDelAppntDataThread, self).__init__(parent)
        self.flag=flag
        self.data=data
    def run(self):
        try:
                pool = ConnectionPool(5, 'hms_database.db')
                if(self.flag==1):
                     addApptsData(pool,self.data)
                elif(self.flag==2):
                     updtApptsData(pool,self.data)
                elif(self.flag==3):
                     delApptsData(pool,self.data)
                self.operationComplete.emit()

        except Exception as e:
            print(e)


