    def updateAppntTable(self,data):
        self.appnt_data_thread.retrievalComplete.connect(self.appnt_data_thread.terminate)
        for row_number, row_data in enumerate(data):
            self.tableAppntDet.insertRow(row_number)
            for column_number, column_data in enumerate(row_data):
                item = QtWidgets.QTableWidgetItem(str(column_data))
                self.tableAppntDet.setItem(row_number, column_number, item)
         
    def showWarningMessage(self,message):
        msgBox = QtWidgets.QMessageBox()
        msgBox.setIcon(QtWidgets.QMessageBox.Warning)
        msgBox.setWindowTitle("Warning")
        msgBox.setText(message)
        msgBox.setStandardButtons(QtWidgets.QMessageBox.Ok)
        msgBox.exec_()

    def verifyData(self,data):
        if not checkEmptyFields(data):
                self.showWarningMessage("All Fields are mandatory!!")
        else:
                if  checkNumericalData(data[0]) and not checkPhone(data[3]):
                     self.showWarningMessage("Phone field value wrong!!")
                else:
                     if checkLicenseNumber(data[0],self.tableAppntDet):
                        return True
                     else:
                          self.showWarningMessage("Id in use or wrong entry!!")
        return False    

    def addData(self):
        data = (self.apptIdEntry.toPlainText().strip(),self.docNameEntry.toPlainText().strip(),
                self.patNameEntry.toPlainText().strip(),self.patPhoneEntry.toPlainText().strip(),
                self.apptDateEntry.toPlainText().strip(),self.apptTimeEntry.toPlainText().strip())
        if self.verifyData(data):
                self.appnt_add_updt_thread = AddUpdateDelAppntDataThread(data,flag=1)
                self.appnt_add_updt_thread.start()
                self.appnt_add_updt_thread.operationComplete.connect(self.refreshTable)

    def verifyUpdtData(self,data):
        if not checkEmptyFields(data):
                self.showWarningMessage("All Fields are mandatory!!")
        else:
                if  checkNumericalData(data[0]) and not checkPhone(data[3]):
                     self.showWarningMessage("Phone field value wrong!!")
                else:
                     row = getSelectedRowData(self.tableAppntDet)
                     if row is not None and str(row[0]) == str(data[0]):
                        return True  
                     elif row is not None and not checkLicenseNumber(data[0],self.tableAppntDet):
                        self.showWarningMessage("Id in use or wrong entry!!")
                     else:
                        self.showWarningMessage("Record not selected")
        return False   

    def updtData(self):
        data = (self.apptIdEntry.toPlainText().strip(),self.docNameEntry.toPlainText().strip(),
                self.patNameEntry.toPlainText().strip(),self.patPhoneEntry.toPlainText().strip(),
                self.apptDateEntry.toPlainText().strip(),self.apptTimeEntry.toPlainText().strip(),
                self.apptIdEntry.toPlainText().strip())
        if self.verifyUpdtData(data):
             self.appnt_add_updt_thread = AddUpdateDelAppntDataThread(data,flag=2)
             self.appnt_add_updt_thread.start()
             self.appnt_add_updt_thread.operationComplete.connect(self.refreshTable)
    
    def delData(self):
        row = getSelectedRowData(self.tableAppntDet)
        if row is not None:
                selected_lic_no = row[0]
                self.appnt_add_updt_thread = AddUpdateDelAppntDataThread(selected_lic_no,flag=3)
                self.appnt_add_updt_thread.start()
                self.appnt_add_updt_thread.operationComplete.connect(self.refreshTable)
        else:
             self.showWarningMessage("Please select record!!") 
    
    def refreshTable(self):
        self.tableAppntDet.clearContents()
        self.tableAppntDet.setRowCount(0)
        self.appnt_data_thread = AppntDataRetrievalThread()
        self.appnt_data_thread.dataRetrieved.connect(self.updateAppntTable)
        self.appnt_data_thread.start()

